main:
	#Calling load function to load frame 1 bitmap by loading it in $t4
	frame1: lui $9, 0x1001
		add $10, $0, $0
		la $11, l3n0
		jal load
		
		#Setting a loop to delay the frame transition
		addi $s0, $zero, 1000000
		addi $t7, $zero, 0
		timerLoop:	bge $t7, $s0, frame2
				addi $t7, $t7, 1
			 	j timerLoop
	
	#Calling load function to load frame 2 bitmap by loading it in $t4
	frame2:	lui $9, 0x1001
   		add $10, $0, $0
   		la $11, l2n0
		jal load
		
		#Setting a loop to delay the frame transition
		addi $s0, $zero, 1000000
		addi $t7, $zero, 0
		timerLoop2:	bge $t7, $s0, frame1
				addi $t7, $t7, 1
			 	j timerLoop2

#Function to load the bitmap according to the frame placed as
# a parameter in the $t4
load:
    lw $12, 0($11)	
    sw $12, 0($9)
	
    addi $9,$9, 4
    addi $10,$10, 1
    addi $11, $11, 4
    bne $10, 8192, load
